import { createMuiTheme } from '@material-ui/core/styles';

const Preferences = createMuiTheme({
  palette: {
    primary: {
      main: 'rgba(255, 0, 0, 1)',
    },
    secondary: {
      main: 'rgba(255, 0, 0, 1)',
    },
  },
});

export default Preferences;
